--
-- Disparadores `tbl_detalle_compra`
--
DELIMITER $$
CREATE TRIGGER `Tr_item` BEFORE INSERT ON `tbl_detalle_compra` FOR EACH ROW BEGIN
   DECLARE nuevo_valor SMALLINT;
   SELECT MAX(item) INTO nuevo_valor FROM tbl_detalle_compra;
   SET nuevo_valor = IFNULL(nuevo_valor, 0) + 1;
   SET NEW.item = nuevo_valor;
END
$$
DELIMITER ;

